import React, { useEffect, useState } from 'react';
import axios from 'axios';
import styles from './ManageRequest.module.css';

const ManageRequest = () => {
  const [requests, setRequests] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  useEffect(() => {
    const fetchRequests = () => {
      axios.get('http://localhost:8080/requests/data')
        .then(response => {
          setRequests(response.data);
          setLoading(false);
        })
        .catch(error => {
          console.error('Error fetching requests:', error);
          setError('Failed to load requests');
          setLoading(false);
        });
    };

    fetchRequests();
    
    // Refresh requests every 30 seconds
    const interval = setInterval(fetchRequests, 30000);
    return () => clearInterval(interval);
  }, []);

  const handleStatusUpdate = (id, newStatus) => {
    axios.put(`http://localhost:8080/requests/${id}/status`, { status: newStatus })
      .then(response => {
        setRequests(requests.map(req => 
          req.requestId === id ? response.data : req
        ));
        setSuccess(`Request #${id} marked as ${newStatus}`);
        setTimeout(() => setSuccess(''), 3000);
      })
      .catch(error => {
        console.error('Error updating status:', error);
        setError('Failed to update request status');
        setTimeout(() => setError(''), 3000);
      });
  };

  const getServiceName = (serviceId) => {
    const services = {
      1: 'Plumbing',
      2: 'Electricity',
      3: 'Garbage Collection',
      4: 'Maintenance',
      5: 'Cleaning',
      6: 'Security'
    };
    return services[serviceId] || `Service ${serviceId}`;
  };

  if (loading) return <div className={styles.loading}>Loading requests...</div>;

  return (
    <div className={styles.container}>
      <h2 className={styles.heading}>Manage Requests</h2>
      
      {error && <div className={styles.error}>{error}</div>}
      {success && <div className={styles.success}>{success}</div>}

      <div className={styles.requestGrid}>
        {requests.length === 0 ? (
          <p className={styles.noRequests}>No requests found</p>
        ) : (
          requests.map((req) => (
            <div key={req.requestId} className={styles.card}>
              <div className={styles.cardHeader}>
                <h3>Request #{req.requestId}</h3>
                <span className={`${styles.status} ${styles[req.status.toLowerCase()]}`}>
                  {req.status}
                </span>
              </div>
              
              <div className={styles.cardBody}>
                <p><strong>User:</strong> {req.userId}</p>
                <p><strong>Service:</strong> {getServiceName(req.serviceId)}</p>
                <p><strong>Description:</strong></p>
                <div className={styles.description}>{req.description}</div>
                <p><strong>Submitted:</strong> {new Date(req.createDate).toLocaleString()}</p>
                <p><strong>Expected Completion:</strong> {new Date(req.exceptCompletionDate).toLocaleString()}</p>
              </div>

              <div className={styles.cardFooter}>
                {req.status === 'Pending' && (
                  <>
                    <button 
                      className={`${styles.button} ${styles.completeBtn}`}
                      onClick={() => handleStatusUpdate(req.requestId, 'In Progress')}
                    >
                      Start Progress
                    </button>
                    <button 
                      className={`${styles.button} ${styles.cancelBtn}`}
                      onClick={() => handleStatusUpdate(req.requestId, 'Cancelled')}
                    >
                      Cancel
                    </button>
                  </>
                )}
                {req.status === 'In Progress' && (
                  <button 
                    className={`${styles.button} ${styles.completeBtn}`}
                    onClick={() => handleStatusUpdate(req.requestId, 'Completed')}
                  >
                    Mark Completed
                  </button>
                )}
              </div>
            </div>
          ))
        )}
      </div>
    </div>
  );
};

export default ManageRequest;
